import React, { useContext } from 'react';
import { AuthContext } from '../AuthContext';
import '../styles/Dashboard.css';

const Dashboard = () => {
  const { user, logout } = useContext(AuthContext);

  return (
    <div className="dashboard-container">
      <nav className="dashboard-navbar">
        <div className="logo">TecnoQuito</div>
        <ul className="nav-links">
          <li><a href="#reserva">Reserva</a></li>
          <li><a href="#compra">Compra</a></li>
          <li><a href="#alquiler">Alquiler</a></li>
        </ul>
        <button className="logout-button" onClick={logout}>Cerrar Sesi√≥n</button>
      </nav>
      <main className="dashboard-main">
        <h1>Bienvenido a TecnoQuito</h1>
        <p>Ofrecemos servicios de reserva, compra y alquiler de fotocopiadoras empresariales.</p>
      </main>
    </div>
  );
};

export default Dashboard;
